import React, { useState } from "react";
import styles from "./Dashboard.module.css";
import { FiMenu } from "react-icons/fi"; // אייקון לתפריט נפתח

const Dashboard = () => {
  const [isOpen, setIsOpen] = useState(true);

  const toggleDashboard = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div
      className={`${styles.dashboard} ${isOpen ? styles.open : styles.closed}`}
    >
      <button className={styles.menuButton} onClick={toggleDashboard}>
        <FiMenu size={23} color="white" />
      </button>
      {isOpen && <div className={styles.content}>Dashboard Content</div>}
    </div>
  );
};

export default Dashboard;
